import React from "react"
import styled from "styled-components"
import { Container, Title } from "./contants"

const Wrapper1 = styled.div``
const Wrapper2 = styled.div``
const Ul = styled.ul`
  background-color: aliceblue;
`
const Li = styled.li`
  list-style: none;
`
const a = {
  audioText: [
    {
      voiceLayer: {
        voiceNumber: "First",
        text: [
          {
            duration: 0,
            content: "đợi",
          },
          {
            duration: 1,
            content: "tôi xin gác mà anh",
          },
        ],
      },
    },
    {
      voiceLayer: {
        voiceNumber: "Second",
        text: [
          {
            duration: 0,
            content: "dạ anh đang có vay bênh bênh em ạ",
          },
          {
            duration: 1,
            content: "em một xíu",
          },
        ],
      },
    },
  ],
}
const Conversation = ({ data }) => {
  return (
    <Container>
      <Title>Conversation</Title>
      <Wrapper1>
        <Wrapper2>
          <Ul>
            {JSON.stringify(data) !== "{}" &&
              data.audioText.map((item) =>
                item.voiceLayer.text.map((item) => <Li>{item.duration}</Li>)
              )}
          </Ul>
        </Wrapper2>
      </Wrapper1>
    </Container>
  )
}

export default Conversation
